function ready(){"function"==typeof PageReady&&PageReady(),$("#Collapse_Button > i").on("click",collapse),$(".btn_cookie_accept").on("click",cookie_accept),$(".btn_cookie_reject").on("click",cookie_reject),$("#Floating_Objects").on("click",(function(){$("html,body").stop().animate({scrollTop:0},0)}));new Swiper(".mySwiper",{slidesPerView:1,spaceBetween:30,loop:!0,pagination:{el:".swiper-pagination",clickable:!0},navigation:{nextEl:".swiper-button-next",prevEl:".swiper-button-prev"}})}function collapse(){$("footer").toggleClass("footer_pack_up")}function cookie_accept(){$("#Cookie").toggleClass("cookie_close")}function cookie_reject(){$("#Cookie").toggleClass("cookie_close")}